ed&quot;&lt;/a&gt; to make sure you&#39;re prepared to use the AWS SDK for PHP. No seriously, read it.&lt;/p&gt;</span></div><div class='line' id='LC672'><span class="x">		&lt;/div&gt;</span></div><div class='line' id='LC673'><span class="x">		</span><span class="cp">&lt;?php</span> <span class="k">elseif</span> <span class="p">(</span><span class="nv">$php_ok</span> <span class="o">&amp;&amp;</span> <span class="nv">$curl_ok</span> <span class="o">&amp;&amp;</span> <span class="nv">$simplexml_ok</span> <span class="o">&amp;&amp;</span> <span class="nv">$dom_ok</span> <span class="o">&amp;&amp;</span> <span class="nv">$spl_ok</span> <span class="o">&amp;&amp;</span> <span class="nv">$json_ok</span> <span class="o">&amp;&amp;</span> <span class="nv">$pcre_ok</span> <span class="o">&amp;&amp;</span> <span class="nv">$file_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC674'><span class="x">		&lt;div class=&quot;chunk important ok&quot;&gt;</span></div><div class='line' id='LC675'><span class="x">			&lt;h3&gt;Bottom Line: Yes, you can!&lt;/h3&gt;</span></div><div class='line' id='LC676'><span class="x">			&lt;p&gt;Your PHP environment is ready to go! &lt;i&gt;There are a couple of minor features that you won&#39;t be able to take advantage of, but nothing that&#39;s a show-stopper.&lt;/i&gt;&lt;/p&gt;</span></div><div class='line' id='LC677'><span class="x">		&lt;/div&gt;</span></div><div class='line' id='LC678'><span class="x">		&lt;div class=&quot;chunk&quot;&gt;</span></div><div class='line' id='LC679'><span class="x">			&lt;h3&gt;What&#39;s Next?&lt;/h3&gt;</span></div><div class='line' id='LC680'><span class="x">			&lt;p&gt;You can download the latest version of the &lt;a href=&quot;http://aws.amazon.com/sdkforphp&quot;&gt;&lt;strong&gt;AWS SDK for PHP&lt;/strong&gt;&lt;/a&gt; and install it by &lt;a href=&quot;http://aws.amazon.com/articles/4261&quot;&gt;following the instructions&lt;/a&gt;. Also, check out our library of &lt;a href=&quot;http://aws.amazon.com/articles/4262&quot;&gt;screencasts and tutorials&lt;/a&gt;.&lt;/p&gt;</span></div><div class='line' id='LC681'><span class="x">			&lt;p&gt;Take the time to read &lt;a href=&quot;http://aws.amazon.com/articles/4261&quot;&gt;&quot;Getting Started&quot;&lt;/a&gt; to make sure you&#39;re prepared to use the AWS SDK for PHP. No seriously, read it.&lt;/p&gt;</span></div><div class='line' id='LC682'><span class="x">		&lt;/div&gt;</span></div><div class='line' id='LC683'><span class="x">		</span><span class="cp">&lt;?php</span> <span class="k">else</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC684'><span class="x">		&lt;div class=&quot;chunk important error&quot;&gt;</span></div><div class='line' id='LC685'><span class="x">			&lt;h3&gt;Bottom Line: We&#39;re sorry&amp;hellip;&lt;/h3&gt;</span></div><div class='line' id='LC686'><span class="x">			&lt;p&gt;Your PHP environment does not support the minimum requirements for the &lt;strong&gt;AWS SDK for PHP&lt;/strong&gt;.&lt;/p&gt;</span></div><div class='line' id='LC687'><span class="x">		&lt;/div&gt;</span></div><div class='line' id='LC688'><span class="x">		&lt;div class=&quot;chunk&quot;&gt;</span></div><div class='line' id='LC689'><span class="x">			&lt;h3&gt;What&#39;s Next?&lt;/h3&gt;</span></div><div class='line' id='LC690'><span class="x">			&lt;p&gt;If you&#39;re using a shared hosting plan, it may be a good idea to contact your web host and ask them to install a more recent version of PHP and relevant extensions.&lt;/p&gt;</span></div><div class='line' id='LC691'><span class="x">			&lt;p&gt;If you have control over your PHP environment, we recommended that you upgrade your PHP environment. Check out the &quot;Set Up Your Environment&quot; section of the &lt;a href=&quot;http://aws.amazon.com/articles/4261&quot;&gt;Getting Started Guide&lt;/a&gt; for more information.&lt;/p&gt;</span></div><div class='line' id='LC692'><span class="x">		&lt;/div&gt;</span></div><div class='line' id='LC693'><span class="x">		</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC694'><br/></div><div class='line' id='LC695'><span class="x">		</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="nv">$apc_ok</span> <span class="o">||</span> <span class="nv">$xcache_ok</span> <span class="o">||</span> <span class="nv">$file_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC696'><span class="x">		&lt;div class=&quot;chunk&quot;&gt;</span></div><div class='line' id='LC697'><span class="x">			&lt;h3&gt;Recommended settings for config.inc.php&lt;/h3&gt;</span></div><div class='line' id='LC698'><span class="x">			&lt;p&gt;Based on your particular server configuration, the following settings are recommended.&lt;/p&gt;</span></div><div class='line' id='LC699'><span class="x">			&lt;br&gt;</span></div><div class='line' id='LC700'><span class="x">			&lt;table cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; border=&quot;0&quot; width=&quot;100%&quot; class=&quot;chart&quot;&gt;</span></div><div class='line' id='LC701'><span class="x">				&lt;thead&gt;</span></div><div class='line' id='LC702'><span class="x">					&lt;tr&gt;</span></div><div class='line' id='LC703'><span class="x">						&lt;th&gt;Configuration Setting&lt;/th&gt;</span></div><div class='line' id='LC704'><span class="x">						&lt;th&gt;Recommended Value&lt;/th&gt;</span></div><div class='line' id='LC705'><span class="x">					&lt;/tr&gt;</span></div><div class='line' id='LC706'><span class="x">				&lt;/thead&gt;</span></div><div class='line' id='LC707'><span class="x">				&lt;tbody&gt;</span></div><div class='line' id='LC708'><span class="x">					&lt;tr&gt;</span></div><div class='line' id='LC709'><span class="x">						&lt;td&gt;&lt;code&gt;default_cache_config&lt;/code&gt;&lt;/td&gt;</span></div><div class='line' id='LC710'><span class="x">						</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="nv">$apc_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC711'><span class="x">						&lt;td&gt;&lt;code&gt;apc&lt;/code&gt;&lt;/td&gt;</span></div><div class='line' id='LC712'><span class="x">						</span><span class="cp">&lt;?php</span> <span class="k">elseif</span> <span class="p">(</span><span class="nv">$xcache_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC713'><span class="x">						&lt;td&gt;&lt;code&gt;xcache&lt;/code&gt;&lt;/td&gt;</span></div><div class='line' id='LC714'><span class="x">						</span><span class="cp">&lt;?php</span> <span class="k">elseif</span> <span class="p">(</span><span class="nv">$file_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC715'><span class="x">						&lt;td&gt;Any valid, server-writable file system path&lt;/td&gt;</span></div><div class='line' id='LC716'><span class="x">						</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC717'><span class="x">					&lt;/tr&gt;</span></div><div class='line' id='LC718'><span class="x">					&lt;tr&gt;</span></div><div class='line' id='LC719'><span class="x">						&lt;td&gt;&lt;code&gt;certificate_authority&lt;/code&gt;&lt;/td&gt;</span></div><div class='line' id='LC720'><span class="x">						</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="nx">is_windows</span><span class="p">())</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC721'><span class="x">						&lt;td id=&quot;ssl_check&quot;&gt;&lt;code&gt;true&lt;/code&gt;&lt;/td&gt;</span></div><div class='line' id='LC722'><span class="x">						</span><span class="cp">&lt;?php</span> <span class="k">else</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC723'><span class="x">						&lt;td id=&quot;ssl_check&quot;&gt;&lt;img src=&quot;</span><span class="cp">&lt;?php</span> <span class="k">echo</span> <span class="nb">pathinfo</span><span class="p">(</span><span class="k">__FILE__</span><span class="p">,</span> <span class="nx">PATHINFO_BASENAME</span><span class="p">);</span> <span class="cp">?&gt;</span><span class="x">?loader&quot; alt=&quot;Loading...&quot;&gt;&lt;/td&gt;</span></div><div class='line' id='LC724'><span class="x">						</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC725'><span class="x">					&lt;/tr&gt;</span></div><div class='line' id='LC726'><span class="x">				&lt;/tbody&gt;</span></div><div class='line' id='LC727'><span class="x">			&lt;/table&gt;</span></div><div class='line' id='LC728'><span class="x">			&lt;br&gt;</span></div><div class='line' id='LC729'><span class="x">		&lt;/div&gt;</span></div><div class='line' id='LC730'><span class="x">		</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC731'><br/></div><div class='line' id='LC732'><span class="x">		&lt;div class=&quot;chunk&quot;&gt;</span></div><div class='line' id='LC733'><span class="x">			&lt;h3&gt;Give me the details!&lt;/h3&gt;</span></div><div class='line' id='LC734'><span class="x">			</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="nv">$php_ok</span> <span class="o">&amp;&amp;</span> <span class="nv">$curl_ok</span> <span class="o">&amp;&amp;</span> <span class="nv">$simplexml_ok</span> <span class="o">&amp;&amp;</span> <span class="nv">$dom_ok</span> <span class="o">&amp;&amp;</span> <span class="nv">$spl_ok</span> <span class="o">&amp;&amp;</span> <span class="nv">$json_ok</span> <span class="o">&amp;&amp;</span> <span class="nv">$pcre_ok</span> <span class="o">&amp;&amp;</span> <span class="nv">$file_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC735'><span class="x">			&lt;ol&gt;</span></div><div class='line' id='LC736'><span class="x">				&lt;li&gt;&lt;em&gt;Your environment meets the minimum requirements for using the &lt;strong&gt;AWS SDK for PHP&lt;/strong&gt;!&lt;/em&gt;&lt;/li&gt;</span></div><div class='line' id='LC737'><br/></div><div class='line' id='LC738'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="nb">version_compare</span><span class="p">(</span><span class="k">PHP_VERSION</span><span class="p">,</span> <span class="s1">&#39;5.3.0&#39;</span><span class="p">)</span> <span class="o">&lt;</span> <span class="mi">0</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC739'><span class="x">				&lt;li&gt;You&#39;re still running &lt;strong&gt;PHP </span><span class="cp">&lt;?php</span> <span class="k">echo</span> <span class="k">PHP_VERSION</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x">&lt;/strong&gt;. The PHP 5.2 family is no longer supported by the PHP team, and future versions of the AWS SDK for PHP will &lt;i&gt;require&lt;/i&gt; PHP 5.3 or newer.&lt;/li&gt;</span></div><div class='line' id='LC740'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC741'><br/></div><div class='line' id='LC742'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="nv">$openssl_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC743'><span class="x">				&lt;li&gt;The &lt;a href=&quot;http://php.net/openssl&quot;&gt;OpenSSL&lt;/a&gt; extension is installed. This will allow you to use &lt;a href=&quot;http://docs.amazonwebservices.com/AmazonCloudFront/latest/DeveloperGuide/PrivateContent.html&quot;&gt;CloudFront Private URLs&lt;/a&gt; and decrypt Microsoft&amp;reg; Windows&amp;reg; instance passwords.&lt;/li&gt;</span></div><div class='line' id='LC744'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC745'><br/></div><div class='line' id='LC746'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="nv">$zlib_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC747'><span class="x">				&lt;li&gt;The &lt;a href=&quot;http://php.net/zlib&quot;&gt;Zlib&lt;/a&gt; extension is installed. The SDK will request gzipped data whenever possible.&lt;/li&gt;</span></div><div class='line' id='LC748'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC749'><br/></div><div class='line' id='LC750'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="o">!</span><span class="nv">$int64_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC751'><span class="x">				&lt;li&gt;You&#39;re running on a &lt;strong&gt;32-bit&lt;/strong&gt; system. This means that PHP does not correctly handle files larger than 2GB (this is a &lt;a href=&quot;http://www.google.com/search?q=php+2gb+32-bit&quot;&gt;well-known PHP issue&lt;/a&gt;). For more information, please see: &lt;a href=&quot;http://docs.php.net/manual/en/function.filesize.php#refsect1-function.filesize-returnvalues&quot;&gt;PHP filesize: Return values&lt;/a&gt;.&lt;/li&gt;</span></div><div class='line' id='LC752'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="nx">is_windows</span><span class="p">())</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC753'><span class="x">				&lt;li id=&quot;win64&quot;&gt;&lt;em&gt;Note that PHP on Microsoft® Windows® &lt;a href=&quot;http://j.mp/php64win&quot;&gt;does not support 64-bit integers at all&lt;/a&gt;, even if both the hardware and PHP are 64-bit.&lt;/em&gt;&lt;/li&gt;</span></div><div class='line' id='LC754'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC755'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC756'><br/></div><div class='line' id='LC757'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="nv">$ini_open_basedir</span> <span class="o">||</span> <span class="nv">$ini_safe_mode</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC758'><span class="x">				&lt;li&gt;You have &lt;a href=&quot;http://php.net/open_basedir&quot;&gt;open_basedir&lt;/a&gt; or &lt;a href=&quot;http://php.net/safe_mode&quot;&gt;safe_mode&lt;/a&gt; enabled in your &lt;code&gt;php.ini&lt;/code&gt; file. Sometimes PHP behaves strangely when these settings are enabled. Disable them if you can.&lt;/li&gt;</span></div><div class='line' id='LC759'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC760'><br/></div><div class='line' id='LC761'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="o">!</span><span class="nv">$ini_zend_enable_gc</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC762'><span class="x">				&lt;li&gt;The PHP garbage collector (available in PHP 5.3+) is not enabled in your &lt;code&gt;php.ini&lt;/code&gt; file. Enabling &lt;a href=&quot;http://php.net/zend.enable_gc&quot;&gt;zend.enable_gc&lt;/a&gt; will provide better memory management in the PHP core.&lt;/li&gt;</span></div><div class='line' id='LC763'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC764'><br/></div><div class='line' id='LC765'><span class="x">				</span><span class="cp">&lt;?php</span></div><div class='line' id='LC766'>				<span class="nv">$storage_types</span> <span class="o">=</span> <span class="k">array</span><span class="p">();</span></div><div class='line' id='LC767'>				<span class="k">if</span> <span class="p">(</span><span class="nv">$file_ok</span><span class="p">)</span> <span class="p">{</span> <span class="nv">$storage_types</span><span class="p">[]</span> <span class="o">=</span> <span class="s1">&#39;&lt;a href=&quot;http://php.net/file_put_contents&quot;&gt;The file system&lt;/a&gt;&#39;</span><span class="p">;</span> <span class="p">}</span></div><div class='line' id='LC768'>				<span class="k">if</span> <span class="p">(</span><span class="nv">$apc_ok</span><span class="p">)</span> <span class="p">{</span> <span class="nv">$storage_types</span><span class="p">[]</span> <span class="o">=</span> <span class="s1">&#39;&lt;a href=&quot;http://php.net/apc&quot;&gt;APC&lt;/a&gt;&#39;</span><span class="p">;</span> <span class="p">}</span></div><div class='line' id='LC769'>				<span class="k">if</span> <span class="p">(</span><span class="nv">$xcache_ok</span><span class="p">)</span> <span class="p">{</span> <span class="nv">$storage_types</span><span class="p">[]</span> <span class="o">=</span> <span class="s1">&#39;&lt;a href=&quot;http://xcache.lighttpd.net&quot;&gt;XCache&lt;/a&gt;&#39;</span><span class="p">;</span> <span class="p">}</span></div><div class='line' id='LC770'>				<span class="k">if</span> <span class="p">(</span><span class="nv">$sqlite_ok</span> <span class="o">&amp;&amp;</span> <span class="nv">$sqlite3_ok</span><span class="p">)</span> <span class="p">{</span> <span class="nv">$storage_types</span><span class="p">[]</span> <span class="o">=</span> <span class="s1">&#39;&lt;a href=&quot;http://php.net/sqlite3&quot;&gt;SQLite 3&lt;/a&gt;&#39;</span><span class="p">;</span> <span class="p">}</span></div><div class='line' id='LC771'>				<span class="k">elseif</span> <span class="p">(</span><span class="nv">$sqlite_ok</span> <span class="o">&amp;&amp;</span> <span class="nv">$sqlite2_ok</span><span class="p">)</span> <span class="p">{</span> <span class="nv">$storage_types</span><span class="p">[]</span> <span class="o">=</span> <span class="s1">&#39;&lt;a href=&quot;http://php.net/sqlite&quot;&gt;SQLite 2&lt;/a&gt;&#39;</span><span class="p">;</span> <span class="p">}</span></div><div class='line' id='LC772'>				<span class="k">if</span> <span class="p">(</span><span class="nv">$memcached_ok</span><span class="p">)</span> <span class="p">{</span> <span class="nv">$storage_types</span><span class="p">[]</span> <span class="o">=</span> <span class="s1">&#39;&lt;a href=&quot;http://php.net/memcached&quot;&gt;Memcached&lt;/a&gt;&#39;</span><span class="p">;</span> <span class="p">}</span></div><div class='line' id='LC773'>				<span class="k">elseif</span> <span class="p">(</span><span class="nv">$memcache_ok</span><span class="p">)</span> <span class="p">{</span> <span class="nv">$storage_types</span><span class="p">[]</span> <span class="o">=</span> <span class="s1">&#39;&lt;a href=&quot;http://php.net/memcache&quot;&gt;Memcache&lt;/a&gt;&#39;</span><span class="p">;</span> <span class="p">}</span></div><div class='line' id='LC774'>				<span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC775'><span class="x">				&lt;li&gt;Storage types available for response caching: </span><span class="cp">&lt;?php</span> <span class="k">echo</span> <span class="nb">implode</span><span class="p">(</span><span class="s1">&#39;, &#39;</span><span class="p">,</span> <span class="nv">$storage_types</span><span class="p">);</span> <span class="cp">?&gt;</span><span class="x">&lt;/li&gt;</span></div><div class='line' id='LC776'><span class="x">			&lt;/ol&gt;</span></div><div class='line' id='LC777'><br/></div><div class='line' id='LC778'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="o">!</span><span class="nv">$openssl_ok</span> <span class="o">&amp;&amp;</span> <span class="o">!</span><span class="nv">$zlib_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC779'><span class="x">				&lt;p class=&quo