tension, which means that you won&#39;t be able to take advantage of &lt;a href=&quot;http://docs.amazonwebservices.com/AmazonCloudFront/latest/DeveloperGuide/PrivateContent.html&quot;&gt;CloudFront Private URLs&lt;/a&gt; or decrypt Microsoft&amp;reg; Windows&amp;reg; instance passwords.&lt;/p&gt;</span></div><div class='line' id='LC784'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC785'><br/></div><div class='line' id='LC786'><span class="x">			</span><span class="cp">&lt;?php</span> <span class="k">else</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC787'><span class="x">			&lt;ol&gt;</span></div><div class='line' id='LC788'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="o">!</span><span class="nv">$php_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC789'><span class="x">					&lt;li&gt;&lt;strong&gt;PHP:&lt;/strong&gt; You are running an unsupported version of PHP.&lt;/li&gt;</span></div><div class='line' id='LC790'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC791'><br/></div><div class='line' id='LC792'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="o">!</span><span class="nv">$curl_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC793'><span class="x">					&lt;li&gt;&lt;strong&gt;cURL:&lt;/strong&gt; The &lt;a href=&quot;http://php.net/curl&quot;&gt;cURL&lt;/a&gt; extension is not available. Without cURL, the SDK cannot connect to &amp;mdash; or authenticate with &amp;mdash; Amazon&#39;s services.&lt;/li&gt;</span></div><div class='line' id='LC794'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC795'><br/></div><div class='line' id='LC796'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="o">!</span><span class="nv">$simplexml_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC797'><span class="x">					&lt;li&gt;&lt;strong&gt;SimpleXML:&lt;/strong&gt; The &lt;a href=&quot;http://php.net/simplexml&quot;&gt;SimpleXML&lt;/a&gt; extension is not available. Without SimpleXML, the SDK cannot parse the XML responses from Amazon&#39;s services.&lt;/li&gt;</span></div><div class='line' id='LC798'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC799'><br/></div><div class='line' id='LC800'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="o">!</span><span class="nv">$dom_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC801'><span class="x">					&lt;li&gt;&lt;strong&gt;DOM:&lt;/strong&gt; The &lt;a href=&quot;http://php.net/dom&quot;&gt;DOM&lt;/a&gt; extension is not available. Without DOM, the SDK cannot transliterate JSON responses from Amazon&#39;s services into the common SimpleXML-based pattern used throughout the SDK.&lt;/li&gt;</span></div><div class='line' id='LC802'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC803'><br/></div><div class='line' id='LC804'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="o">!</span><span class="nv">$spl_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC805'><span class="x">					&lt;li&gt;&lt;strong&gt;SPL:&lt;/strong&gt; &lt;a href=&quot;http://php.net/spl&quot;&gt;Standard PHP Library&lt;/a&gt; support is not available. Without SPL support, the SDK cannot autoload the required PHP classes.&lt;/li&gt;</span></div><div class='line' id='LC806'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC807'><br/></div><div class='line' id='LC808'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="o">!</span><span class="nv">$json_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC809'><span class="x">					&lt;li&gt;&lt;strong&gt;JSON:&lt;/strong&gt; &lt;a href=&quot;http://php.net/json&quot;&gt;JSON&lt;/a&gt; support is not available. AWS leverages JSON heavily in many of its services.&lt;/li&gt;</span></div><div class='line' id='LC810'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC811'><br/></div><div class='line' id='LC812'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="o">!</span><span class="nv">$pcre_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC813'><span class="x">					&lt;li&gt;&lt;strong&gt;PCRE:&lt;/strong&gt; Your PHP installation doesn&#39;t support Perl-Compatible Regular Expressions (PCRE). Without PCRE, the SDK cannot do any filtering via regular expressions.&lt;/li&gt;</span></div><div class='line' id='LC814'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC815'><br/></div><div class='line' id='LC816'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="o">!</span><span class="nv">$file_ok</span><span class="p">)</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC817'><span class="x">					&lt;li&gt;&lt;strong&gt;File System Read/Write:&lt;/strong&gt; The &lt;a href=&quot;http://php.net/file_get_contents&quot;&gt;file_get_contents()&lt;/a&gt; and/or &lt;a href=&quot;http://php.net/file_put_contents&quot;&gt;file_put_contents()&lt;/a&gt; functions have been disabled. Without them, the SDK cannot read from, or write to, the file system.&lt;/li&gt;</span></div><div class='line' id='LC818'><span class="x">				</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC819'><span class="x">			&lt;/ol&gt;</span></div><div class='line' id='LC820'><span class="x">			</span><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC821'><span class="x">		&lt;/div&gt;</span></div><div class='line' id='LC822'><br/></div><div class='line' id='LC823'><span class="x">		&lt;div class=&quot;chunk&quot;&gt;</span></div><div class='line' id='LC824'><span class="x">			&lt;p class=&quot;footnote&quot;&gt;&lt;strong&gt;NOTE&lt;/strong&gt;: Passing this test does not guarantee that the AWS SDK for PHP will run on your web server &amp;mdash; it only ensures that the requirements have been addressed.&lt;/p&gt;</span></div><div class='line' id='LC825'><span class="x">		&lt;/div&gt;</span></div><div class='line' id='LC826'><span class="x">	&lt;/div&gt;</span></div><div class='line' id='LC827'><br/></div><div class='line' id='LC828'><span class="x">&lt;/div&gt;</span></div><div class='line' id='LC829'><br/></div><div class='line' id='LC830'><span class="cp">&lt;?php</span> <span class="k">if</span> <span class="p">(</span><span class="o">!</span><span class="nx">is_windows</span><span class="p">())</span><span class="o">:</span> <span class="cp">?&gt;</span><span class="x"></span></div><div class='line' id='LC831'><span class="x">&lt;script type=&quot;text/javascript&quot; charset=&quot;utf-8&quot;&gt;</span></div><div class='line' id='LC832'><span class="x">reqwest(&#39;</span><span class="cp">&lt;?php</span> <span class="k">echo</span> <span class="nb">pathinfo</span><span class="p">(</span><span class="k">__FILE__</span><span class="p">,</span> <span class="nx">PATHINFO_BASENAME</span><span class="p">);</span> <span class="cp">?&gt;</span><span class="x">?ssl_check&#39;, function(resp) {</span></div><div class='line' id='LC833'><span class="x">	$sslCheck = document.getElementById(&#39;ssl_check&#39;);</span></div><div class='line' id='LC834'><span class="x">	$sslCheck.innerHTML = &#39;&#39;;</span></div><div class='line' id='LC835'><span class="x">	$sslCheck.innerHTML = &#39;&lt;code&gt;&#39; + resp + &#39;&lt;/code&gt;&#39;;</span></div><div class='line' id='LC836'><span class="x">});</span></div><div class='line' id='LC837'><span class="x">&lt;/script&gt;</span></div><div class='line' id='LC838'><span class="cp">&lt;?php</span> <span class="k">endif</span><span class="p">;</span> <span clas